import React, { PureComponent } from 'react';

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <div class="page-header">
                <h1>后台信息系统 <small>欢迎您：{this.props.user}</small></h1>
            </div>
        )
    }
    
}

export default Header;
